def solve(lst, k, m):
  result = lst[:]
  for _ in range(k):
    for i in range(1, len(result)):
      result[i] = (result[i-1] + result[i]) % m

  return result


def gcd_ex(a, b):
  if a == 0:
    return b, 0, 1

  d, x, y = gcd_ex(b%a, a)

  return d, y-(b//a)*x, x

def reciprocal_mod(x, m):
  gcd, x, _ = gcd_ex(x, m)

  return x % m if gcd == 1 else None

def solve2(lst, k, m):
  result = lst[:]
  n = len(result)
  for i in range(1, n):
    term = k
    sign = 1
    for j in range(1, i+1):
      t = term
      t = (t*sign) % m
      t = (t*result[i-j]) % m
      result[i] = (result[i] + t) % m

      term = (term * (k-j)) % m
      term = (term * reciprocal_mod(j+1, m)) % m
      sign = m -1 if sign == 1 else 1

  return result

MOD = 998244353
def run(k, n, start, mult):
  arr = [start*(mult**i)%MOD for i in range(n)]

  return solve2(arr, k, MOD)


